import React, { Component } from 'react';
import styled from 'styled-components';

const Container = styled.div`
  background-color: #364C83;
  border-radius: 20px;
  margin-left: 100px;
  margin-right: 100px;
  width: 500px;
  height: 500px;
`;

class Items extends Component {
  render() {
    return (
      <Container>
        <h1>hello</h1>
      </Container>
    );
  }
}

export default Items;
